var container=document.getElementById("container"),button=document.getElementById("button"),article=document.getElementById("articles"),articleRefresh=document.getElementById("articles-refresh"),card=document.getElementById("article-card");$(button).click(function(){$.ajax({type:"GET",url:"http://localhost:3002/webhook/feed",data:{project_id:"16"},error:function(e){alert("Error: There was a problem processing your request, please refresh the browser and try again")},success:function(e){var a=e.feed.length,r=e.feed;$(".articles .article-card").remove();for(var t=0;t<a;t++)$(article).append("<div class='col s12 m7 article-card'><div class='card horizontal z-depth-3'><div class='card-stacked'><div class='card-content'><p><h5>"+r[t].title+"</h5></p></div><div class='card-action'><a href='"+r[t].link+"' class='article-link'>Ver noticia completa</a></div></div></div></div>")}})}),$(document).ready(function(){$.ajax({type:"GET",url:"http://localhost:3002/webhook/feed?refresh_all=false",data:{project_id:"16"},error:function(e){alert("Error: There was a problem processing your request, please refresh the browser and try again")},success:function(e){for(var a=e.feed.length,r=e.feed,t=0;t<a;t++)$(article).append("<div class='col s12 m7 article-card'><div class='card horizontal z-depth-3'><div class='card-stacked'><div class='card-content'><p><h5>"+r[t].title+"</h5></p></div><div class='card-action'><a href='"+r[t].link+"' class='article-link'>Ver noticia completa</a></div></div></div></div>")}})});